INSERT INTO posts_post VALUES(1,'Kickstart Your Fitness Journey with Yoga','Discover the power of yoga for both body and mind. Join our yoga classes to enhance your flexibility, strength, and mental clarity. Perfect for all fitness levels, our expert instructors will guide you through each pose with ease and precision.','image/yoga.jpg');
INSERT INTO posts_post VALUES(2,'Transform Your Body with Our Strength Training Programs','Ready to build muscle and increase your strength? Our strength training programs are designed to challenge and motivate you. With state-of-the-art equipment and personalized training plans, you''ll see results faster than ever.','image/strength.jpg');
INSERT INTO posts_post VALUES(3,'Join Our High-Energy Zumba Classes','Dance your way to fitness with our high-energy Zumba classes. Burn calories, boost your mood, and improve your coordination with fun and dynamic dance routines. No dance experience neededâ€”just bring your enthusiasm and a smile!','image/zumba.jpg');
INSERT INTO posts_post VALUES(4,'Relax and Recover with Our Massage Therapy','After a hard workout, treat yourself to a relaxing massage. Our professional massage therapists are here to help you recover, reduce muscle tension, and improve circulation. Book your session today and feel the difference.','image/massage.jpg');
INSERT INTO posts_post VALUES(5,'Achieve Your Goals with Personal Training','Whether you''re a beginner or a seasoned athlete, our personal trainers are here to help you achieve your fitness goals. Get customized workout plans, nutrition advice, and one-on-one coaching to reach your full potential.','image/trainer.jpg');
