CREATE TABLE IF NOT EXISTS "schedule_schedule_enrolled_participants" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "schedule_id" bigint NOT NULL REFERENCES "schedule_schedule" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "schedule_classes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NOT NULL, "duration" bigint NOT NULL, "instructor_id" bigint NOT NULL REFERENCES "schedule_instructor" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NOT NULL);
